import React from 'react'
import { AppContext } from '../App';
import { useContext } from 'react';
import { useNavigate } from "react-router-dom";

function Kindergardens() {
    const {city, kData, users} = useContext(AppContext)
    const navigate = useNavigate();
  return (
    <div> Here is available Kindergardens list for: {city}
    <div className='available'>
    Available:
    {users.map((i) => (
            <div className='content'>
              <div className='userName'> {i.name}</div>
            </div>
          ))}

    {/* {data.map((i) => (
        
            <div className='content'>
              <div className='id'> {i.id}</div>
              <div className='list'> {i.list}</div>
            </div>
          ))} */}
    </div>
    
    </div>
  )
}

export default Kindergardens
